// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;


contract DivorceContract {
    address public party1;
    address public party2;

    mapping(string => uint) public assets; // Asset name to value mapping

    constructor(address _party2) {
        party1 = msg.sender;
        party2 = _party2;
    }

    function addAsset(string memory assetName, uint value) public {
        require(msg.sender == party1 || msg.sender == party2, "Unauthorized");
        require(msg.sender == party1 || msg.sender == party2, "Unauthorized");
        assets[assetName] = value;
    }

    function getAssetValue(string memory assetName) public view returns (uint) {
        return assets[assetName];
    }

    function transferAssetToParty2(string memory assetName) public {
        require(msg.sender == party1, "Unauthorized");
        require(assets[assetName] > 0, "Asset not available");

        uint assetValue = assets[assetName];
        assets[assetName] = 0;

        payable(party2).transfer(assetValue);
    }
}

